import styled from 'styled-components'


const SimpleFlexPageWraper = styled.div`
    display: flex;
    justify-content: center;
    width: 100%;
`;

const PageOuterWrapper = styled.div`

    display: flex;
    flex-flow: column;
    justify-content: flex-start;
    // width: 100%;

`;

export { PageOuterWrapper, SimpleFlexPageWraper };
